import React, { Component } from 'react';
import { Table, Button } from 'reactstrap';
import axios from 'axios';

class TableComponent extends Component {
    constructor(props) {
        super(props);
        this.state = {
            data: {}
        };
        this.onClick = this.onClick.bind(this);
      }

    // componentDidMount() {
    //     axios.get(`http://localhost:8000/api/deliveries.php`)
    //         .then(
    //             res => {
    //                 this.setState ({
    //                     id: res.id
    //                 })
    //             }
    //         )
    // }

    onClick () {
        axios.get ("http://localhost:8000/api/deliveries.php").then(res => {
            console.log("hello" + JSON.stringify(res));
        }).catch(error => {
            console.log(error);
        })
    }

    render () {
        return (
                /* <h1>Deliveries</h1> */
                <Table className="table">
                    <thead>
                        <tr>
                            <th>#</th>
                            <th>Date</th>
                            <th>Name</th>
                            <th>Driver</th>
                            <th>&nbsp;</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <th scope="row">{this.state.id}</th>
                            <td>{this.state.date}</td>
                            <td>{this.state.name}</td>
                            <td>{this.state.driver_id}</td>
                        </tr>
                    </tbody>

                    <Button outline color="primary" onClick = {this.onClick}>Edit</Button>{' '}
                    <Button outline color="danger">Delete</Button>{' '}
                </Table>
        );
    }
}

export default TableComponent;
